    data were collected by Edward Dever of Oregon State University; College of Earth,
    Ocean, and Atmospheric Sciences, and by Woods Hole Oceanographic Institution as
    part of Ocean Observatories Initiative (OOI): Endurance Array, Leg 3. The Lamont-Doherty
